  $c isa country;
  $o has revenue $o_revenue;
  $o_revenue < 1;
  $city isa city; (organization: $o, city: $city) isa located_in;
(city: $city, country: $c) isa in_country; fetch { "country_name": $c.country_name };

match
  $o isa organization;
  $c isa city;
  $country isa country;
  (organization: $o, city: $c) isa located_in;
  $o has revenue $o_revenue;
  $o_revenue > 100000000;
(city: $c, country: $country) isa in_country; fetch { "organization": $o.name, "city": $c.city_name, "country": $country.country_name, "revenue": $o.revenue };

match
  $o isa organization;
  $c isa country;
  $o has nbr_employees $o_nbr_employees;
  $o_nbr_employees > 1000;
  $city isa city; (organization: $o, city: $city) isa located_in;
(city: $city, country: $c) isa in_country; limit 3;
reduce $numOrgs = count($o);

match
  $c isa country;
  $city isa city;
  $o isa organization;
  (city: $city, country: $c) isa in_country;
  (organization: $o, city: $city) isa located_in;
reduce $orgCount = count($o) groupby $c;
sort $orgCount desc;
limit 3;
fetch { "country": $c.country_name, "orgCount": $orgCount };

